/*****************************************
* Create the logos database
*****************************************/
DROP DATABASE IF EXISTS logos_db;
CREATE DATABASE logos_db;
USE logos_db;  -- MySQL command

-- create the tables
CREATE TABLE logos (
	logoID VARCHAR(255) NOT NULL,
	logoName VARCHAR(25) NOT NULL,
	logoSize VARCHAR(6) NOT NULL,
	logoOrder VARCHAR(1) NOT NULL,
	logoResolution VARCHAR(12) NOT NULL,
	logoBkgd VARCHAR(7) NOT NULL,
	logoExtension VARCHAR(3) NOT NULL,
	logoFileName VARCHAR(255) NOT NULL,
	logoZip VARCHAR(255) NOT NULL,
	creationDate DATETIME NOT NULL
);

